import React, { useContext, useEffect } from "react";
import ProductsContext from './context/products/ProductsContext';

import Shirts from './products/shirts/Shirts'
import Shoes from './products/shoes/Shoes'
import Technology from './products/technology/Technology'


const MainPage = () => {

  const productsContext = useContext(ProductsContext);
  const {loading, products, getProducts } = productsContext;

  useEffect(() => {
    getProducts()
  }, [])
    return (
        <div className="block">
            <div className="shoes mb-4">
                {
                    !loading ? (
                        products.length > 0 ? '' : "No data"
                    ):'loading...'
                }
                <Shoes />
            </div>
            <div className="shirts mb-4">
                <Shirts />
            </div>
            <div className="technology mb-2">
                <Technology />
            </div>
        </div>
    )
}

export default MainPage
